import "./Header.css";
import headerLogo from "../../images/HeaderLogo.png";

function Header() {
    
    return (
        <div className = "header">
            <div className="header__content-container">
            <img className="header__image" src = {headerLogo} />
            <div className="header__button-container">
                <button className="header__button header__button_register">
                    <p className="header__button-text header__button-text_auth">Регистрация</p>
                </ button>
                <button className="header__button header__button_auth">
                    <p className="header__button-text header__button-text_auth">Войти</p>
                </button>
            </div>
            </div>
        </div>
            );
}

export default Header;
